/*Table structure for table `admin` */

DROP TABLE IF EXISTS `admin`;

CREATE TABLE `admin` (
  `adminId` int(11) NOT NULL AUTO_INCREMENT,
  `adminEmail` varchar(100) NOT NULL,
  `adminPassword` varchar(45) NOT NULL,
  PRIMARY KEY (`adminId`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;

/*Data for the table `admin` */

insert  into `admin`(`adminId`,`adminEmail`,`adminPassword`) values (2,'monal@gmail.com','monal');

/*Table structure for table `cart_items` */

DROP TABLE IF EXISTS `cart_items`;

CREATE TABLE `cart_items` (
  `cartItemsId` int(11) NOT NULL AUTO_INCREMENT,
  `loginId` varchar(50) NOT NULL,
  `productId` varchar(50) NOT NULL,
  `productQty` int(11) NOT NULL,
  `purchased` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`cartItemsId`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

/*Data for the table `cart_items` */

/*Table structure for table `product` */

DROP TABLE IF EXISTS `product`;

CREATE TABLE `product` (
  `productId` varchar(45) NOT NULL,
  `productName` varchar(50) NOT NULL,
  `productCategory` varchar(45) NOT NULL,
  `productQty` int(11) NOT NULL,
  `productCompany` varchar(45) NOT NULL,
  `productImg` mediumblob,
  `productSummary` varchar(500) DEFAULT NULL,
  `productPrice` double(13,4) NOT NULL DEFAULT '0.0000',
  `productTags` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`productId`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

