/*Table structure for table `review` */

DROP TABLE IF EXISTS `review`;

CREATE TABLE `review` (
  `reviewId` int(11) NOT NULL AUTO_INCREMENT,
  `productId` varchar(45) NOT NULL,
  `userId` varchar(45) NOT NULL,
  `review` varchar(500) NOT NULL,
  PRIMARY KEY (`reviewId`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

/*Data for the table `review` */

/*Table structure for table `userdetails` */

DROP TABLE IF EXISTS `userdetails`;

CREATE TABLE `userdetails` (
  `userDetailId` int(10) NOT NULL AUTO_INCREMENT,
  `userId` varchar(45) NOT NULL,
  `userName` varchar(100) NOT NULL,
  `userMobNum` varchar(50) DEFAULT NULL,
  `userAddress` varchar(100) DEFAULT NULL,
  `userImg` mediumblob,
  PRIMARY KEY (`userDetailId`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;

/*Data for the table `userdetails` */

insert  into `userdetails`(`userDetailId`,`userId`,`userName`,`userMobNum`,`userAddress`,`userImg`) values (1,'MK','Monal Kantharia',NULL,NULL,NULL);

/*Table structure for table `userlogin` */

DROP TABLE IF EXISTS `userlogin`;

CREATE TABLE `userlogin` (
  `userId` varchar(45) NOT NULL,
  `userEmail` varchar(100) NOT NULL,
  `userPassword` varchar(45) NOT NULL,
  PRIMARY KEY (`userEmail`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `userlogin` */

insert  into `userlogin`(`userId`,`userEmail`,`userPassword`) values ('MK','mmkantharia@gmail.com','monal');

